import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import Link from "./Link";


console.log(Link[0].title);

ReactDOM.render(
  <>
  <h1 className="heading_style">This is Heading </h1>


     <Card sname ={Link[0].sname} 
    imgsrc ={Link[0].imgsrc} 
    title={Link[0].title} 
    links ={Link[0].links} 
     />
     <Card sname={Link[1].sname} 
    imgsrc={Link[1].imgsrc} 
    title={Link[1].sname} 
    links={Link[1].sname} 
    />
     <Card sname={Link[2].sname} 
    imgsrc={Link[2].sname}
    title={Link[2].sname} 
    links={Link[2].sname} 
     />
  
  
  
  </>   
    ,document.getElementById("root")
);
